lization by antibodies generated against previous infection or vaccination, reduced efficacy of treatments, potential diagnostic impact, or predicted increase in transmissibility or disease severity.\n        ","width":1000},"id":"1013","type":"Paragraph"},{"attributes":{"data_source":{"id":"4070"},"glyph":{"id":"4230"},"hover_glyph":null,"muted_glyph":null,"name":"Utah_prop","nonselection_glyph":{"id":"4231"},"selection_glyph":{"id":"4245"},"view":{"id":"4233"}},"id":"4232","type":"GlyphRenderer"},{"attributes":{"dimensions":"height"},"id":"2749","type":"PanTool"},{"attributes":{"callback":null},"id":"3909","type":"TapTool"},{"attributes":{"text":"&lt;H2&gt;Characteristics of 2251_127&lt;/H2&gt;","width":1000},"id":"1012","type":"Div"},{"attributes":{"data_source":{"id":"2650"},"glyph":{"id":"2705"},"hover_glyph":null,"muted_glyph":null,"name":"West Virginia","nonselection_glyph":{"id":"2706"},"view":{"id":"2708"}},"id":"2707","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"line_alpha":{"value":0.1},"line_color":{"value":"#FDE724"},"line_width":{"value":2},"size":{"value":7},"x":{"field":"week"},"y":{"field":"New Mexico_prop"}},"id":"3806","type":"Circle"},{"attributes":{"bottom":{"expr":{"id":"2689"}},"fill_color":{"value":"#404387"},"line_color":{"value":"#404387"},"top":{"expr":{"id":"2690"}},"width":{"value":0.8},"x":{"field":"week"}},"id":"2705","type":"VBar"},{"attributes":{"children":[{"id":"2651"},{"id":"2731"}]},"id":"2973","type":"Column"},{"attributes":{"formatter":{"id":"6741"},"major_label_policy":{"id":"6742"},"major_label_text_font_size":"0pt","major_tick_line_color":null,"minor_tick_line_color":null,"ticker":{"id":"3840"}},"id":"3839","type":"CategoricalAxis"},{"attributes":{},"id":"2735","type":"CategoricalScale"},{"attributes":{"data_source":{"id":"3584"},"glyph":{"id":"3805"},"hover_glyph":null,"muted_glyph":null,"name":"New Mexico_prop","nonselection_glyph":{"id":"3806"},"selection_glyph":{"id":"3820"},"view":{"id":"3808"}},"id":"3807","type":"GlyphRenderer"},{"attributes":{"text":"\n        Notable variants of SARS-CoV-2 and notable mutations found.\n        D614G: Logarithmic Prevalence of D614G in 2020 according to sequences in the GISAID database D614G is a missense mutation that affects the spike protein of SARS-CoV-2. The frequency of this mutation in the viral population has increased during the pandemic. G (glycine) has replaced D (aspartic acid) at position 614 in many countries, especially in Europe though more slowly in China and the rest of East Asia, supporting the hypothesis that G increases the transmission rate, which is consistent with higher viral titers and infectivity in vitro.\n        E484K: The name of the mutation, E484K, refers to an exchange whereby the glutamic acid (E) is replaced by lysine (K) at position 484. 484K has been reported to be an escape mutation (i.e., a mutation that improves a virus's ability to evade the host's immune system[138][139]) from at least one form of monoclonal antibody against SARS-CoV-2, indicating there may be a \"possible change in antigenicity\".\n        N501Y denotes a change from asparagine (N) to tyrosine (Y) in amino-acid position 501. Variants with N501Y include P.1 (Brazil/Japan), Variant of Concern 20DEC-01 (UK), 501.V2 (South Africa), and COH.20G/501Y (Columbus, Ohio). This last became the dominant form of the virus in Columbus in late December 2020 and January and appears to have evolved independently of other variants.\n        S477G/N: A highly flexible region in the receptor binding domain (RBD) of SARS-CoV-2, starting from residue 475 and continuing up to residue 485, was identified using bioinformatics and statistical methods in several studies.\n        P681H: Logarithmic Prevalence of P681H in 2020 according to sequences in the GISAID database In January 2021, scientists reported in a preprint that the mutation 'P681H', a characteristic feature of the significant novel SARS-CoV-2 variants detected in the U.K. (B.1.1.7) and Nigeria (B.1.1.207), is showing a significant exponential increase in worldwide frequency, similar to the now globally prevalent 'D614G'.\n        ","width":1000},"id":"1011","type":"Paragraph"},{"attributes":{"source":{"id":"2650"}},"id":"2708","type":"CDSView"},{"attributes":{},"id":"2733","type":"DataRange1d"},{"attributes":{"below":[{"id":"1031"}],"center":[{"id":"1034"},{"id":"1038"},{"id":"1073"}],"left":[{"id":"1035"}],"output_backend":"svg","renderers":[{"id":"1046"},{"id":"1052"},{"id":"1060"}],"title":{"id":"1023"},"toolbar":{"id":"1042"},"toolbar_location":"below","width":1000,"x_range":{"id":"1018"},"x_scale":{"id":"1027"},"y_range":{"id":"1019"},"y_scale":{"id":"1029"}},"id":"1022","subtype":"Figure","type":"Plot"},{"attributes":{"formatter":{"id":"2774"},"major_label_policy":{"id":"2775"},"ticker":{"id":"2743"}},"id":"2742","type":"LinearAxis"},{"attributes":{"bottom":{"expr":{"id":"2691"}},"fill_color":{"value":"#29788E"},"line_color":{"value":"#29788E"},"top":{"expr":{"id":"2692"}},"width":{"value":0.8},"x":{"field":"week"}},"id":"2710","type":"VBar"},{"attributes":{"high":40053,"low":10,"palette":["#BBBBBB","#5e4fa2","#3288bd","#66c2a5","#abdda4","#e6f598","#ffffbf","#fee08b","#fdae61","#f46d43","#d53e4f","#9e0142"]},"id":"1021","type":"LogColorMapper"},{"attributes":{"bottom":{"expr":{"id":"2691"}},"fill_alpha":{"value":0.1},"fill_color":{"value":"#29788E"},"line_alpha":{"value":0.1},"line_color":{"value":"#29788E"},"top":{"expr":{"id":"2692"}},"width":{"value":0.8},"x":{"field":"week"}},"id":"2711","type":"VBar"},{"attributes":{"data_source":{"id":"2650"},"glyph":{"id":"2710"},"hover_glyph":null,"muted_glyph":null,"name":"Virginia","nonselection_glyph":{"id":"2711"},"view":{"id":"2713"}},"id":"2712","type":"GlyphRenderer"},{"attributes":{"source":{"id":"2650"}},"id":"2713","type":"CDSView"},{"attributes":{},"id":"2737","type":"LinearScale"},{"attributes":{"bottom":{"expr":{"id":"2693"}},"fill_color":{"val
